;; **
;;; # HTM on MNIST handwritten digits
;;; 
;; **

;; **
;;; ### TODO
;;; 
;;; * accumulate invariance to affine transformations: rotation, translation, scale
;;;   * unsupervised "pre-training"
;;; * sensory input just pixels?
;;;   * (both black and white pixels having a positive representation?)
;;;   * to allow invariant atoms to be learned (Gabor-like filters?)
;;;   * vs Gabor filter outputs as sensory input
;;;   * BUT in any case - **still** have problem of subsets activating previously learned patterns / templates.
;;;     * will it work to implicitly learn templates by enforcing limits on synapses, and local topographic connections?
;;;     * forcing local (therefore primitive) feature learning
;;; * saccades
;;; * scheduling sparsity level (like k-sparse autoencoders)
;;; * dropout
;;; * local topographic synapses
;;; * multiple layers
;;; * pre-integration lateral inhibition? (compete to receive input bits)
;;; 
;; **

;; @@
(ns htm-mnist.work
  (:require [htm-mnist.core :as this]
            [htm-mnist.gabor :as gabor]
            [htm-mnist.images :as imgs]
            [htm-mnist.encoders :as this-enc]
            [clojure.java.io :as io]
            [org.numenta.sanity.comportex.launchpad :refer [start-runner stop-all-runners]]
            [org.numenta.sanity.comportex.notebook :refer [viz]]
            [gorilla-plot.core :as plot]
            [gorilla-repl.table :refer [table-view]]
            [gorilla-repl.html :refer [html-view]]
            [org.nfrac.comportex.core :as core]
            [org.nfrac.comportex.encoders :as e]
            [org.nfrac.comportex.protocols :as p]
            [org.nfrac.comportex.util :as util]
            [org.nfrac.comportex.repl])
  (:use [clojure.pprint]
        [clojure.stacktrace]))

(org.nfrac.comportex.repl/truncate-large-data-structures)

(defn <img>
  [image w]
  (html-view
    (imgs/inline-img-tag
      image
      {:style (str "width:" w "px")})))

