 (table-view
  (for [inval (take-last 10 (train-inputs fg-indices 1000))]
    (try
     (let [htm (p/htm-step super-trained-30k (dissoc inval :label))]
      [(:label inval)
       (viz image-encoder (:image inval))
       (->> (core/predictions htm :label 1 p/active-cells)
             first :value)
       (-> (get-in htm [:regions :class :layer-3])
           (p/active-columns) #_(first))
       ])
      (catch Exception e
        [(:label inval) (viz image-encoder (:image inval)) nil nil]))
    )
   :columns '[lab image decoded class-cell])

